window.bookSummaryJSON = "<p>A power vacuum up for grabs. A path forward is offered. Rally behind the future.</p> <p>The Aberrants have been pushed off their throne, and the Allied Towns, freed from the clutches of their oppressive rulers, have the opportunity to flourish. Yet, unexpected perils test the mettle of the indomitable Dreg Warriors, and things begin to spiral out of control.</p> <p>As the Bunker Busters come to terms with their growing magic, even dangerous opportunities are sought after to help the forward march through the Quotients.</p> <p>Equipped with formidable weapons and bound by unbreakable bonds, Ronan sets out to bridge the chasm of fear ingrained in the hearts of Earth's denizens.</p>"; 
